DROP TRIGGER IF EXISTS `add_staff`;
DELIMITER //
CREATE TRIGGER `add_staff` AFTER INSERT ON `staff`
 FOR EACH ROW begin
	update department
    	set department.vacancies=department.vacancies-1,
        department.number=department.number+1 where 	
        new.dept_id=department_id;
end
//
DELIMITER ;
DROP TRIGGER IF EXISTS `del_staff`;
DELIMITER //
CREATE TRIGGER `del_staff` AFTER DELETE ON `staff`
 FOR EACH ROW begin
	update department
    	set department.vacancies=department.vacancies+1,
        department.number=department.number-1 where 	
        old.dept_id=department_id;
end
//
DELIMITER ;

